// è½¬æ¢æ•°æ®ä¸ºå±‚æ¬¡ç»“æ„ï¼Œåªä½¿ç”¨nameå±æ€§
function transformMusicData(rawData) {
  const root = {
    name: "éŸ³ä¹é£æ ¼",
    children: []
