    if (categoryItem.subcategories && Array.isArray(categoryItem.subcategories)) {
      // æ”¶é›†æ‰€æœ‰ç›´æ¥æ·»åŠ åˆ°categoryNodeçš„genreèŠ‚ç‚¹ï¼ˆsubcategoryä¸ºnullçš„æƒ…å†µï¼‰
      const directGenres = new Map(); // name -> genreNode

      categoryItem.subcategories.forEach(subcategoryItem => {
        if (subcategoryItem.subcategory) {
          const subcategoryNode = {
            name: subcategoryItem.subcategory,
            children: []
          };

          if (subcategoryItem.genres && Array.isArray(subcategoryItem.genres)) {
            subcategoryItem.genres.forEach(genre => {
              if (genre.name) {
                const genreNode = {
                  name: genre.name,
                  scraped_info: genre.scraped_info || null, // ä¿ç•™scraped_info
                  children: extractChildren(genre)
