        } else {
          // subcategoryä¸ºnullï¼Œç›´æ¥æ·»åŠ åˆ°categoryNode
          if (subcategoryItem.genres && Array.isArray(subcategoryItem.genres)) {
            subcategoryItem.genres.forEach(genre => {
              if (genre.name) {
                const genreNode = {
                  name: genre.name,
                  scraped_info: genre.scraped_info || null, // ä¿ç•™scraped_info
                  children: extractChildren(genre)
