                // å¦‚æœå·²ç»å­˜åœ¨åŒåèŠ‚ç‚¹ï¼Œåˆå¹¶children
                if (directGenres.has(genre.name)) {
                  const existing = directGenres.get(genre.name);
                  // åˆå¹¶childrenï¼Œå»é‡
                  const existingChildrenNames = new Set(existing.children.map(c => c.name));
                  genreNode.children.forEach(child => {
                    if (!existingChildrenNames.has(child.name)) {
                      existing.children.push(child);
                    }
                  });
                } else {
                  directGenres.set(genre.name, genreNode);
                }
              }
            });
          }
        }
      });

      // å°†æ‰€æœ‰ç›´æ¥genreæ·»åŠ åˆ°categoryNode.children
      directGenres.forEach(genreNode => {
        categoryNode.children.push(genreNode);
      });

      // å»é‡ï¼šå¦‚æœæŸä¸ªèŠ‚ç‚¹æ˜¯å¦ä¸€ä¸ªèŠ‚ç‚¹çš„å­èŠ‚ç‚¹ï¼Œåˆ™ä»ç›´æ¥å­èŠ‚ç‚¹ä¸­ç§»é™¤
      const removeDuplicates = (nodes) => {
        if (nodes.length === 0) return nodes;

        const collectAllDescendantNames = (node) => {
          const names = new Set([node.name]);
          if (node.children && node.children.length > 0) {
            node.children.forEach(child => {
              const childNames = collectAllDescendantNames(child);
              childNames.forEach(name => names.add(name));
            });
          }
          return names;
        };

        // è¿‡æ»¤ï¼šåªä¿ç•™é‚£äº›ä¸åœ¨å…¶ä»–èŠ‚ç‚¹çš„åä»£ä¸­çš„èŠ‚ç‚¹
        return nodes.filter(node => {
          // æ£€æŸ¥è¿™ä¸ªèŠ‚ç‚¹æ˜¯å¦åœ¨å…¶ä»–èŠ‚ç‚¹çš„åä»£ä¸­
          for (const otherNode of nodes) {
            if (otherNode === node) continue;
            try {
              const otherDescendants = collectAllDescendantNames(otherNode);
              if (otherDescendants.has(node.name)) {
                return false; // è¿™ä¸ªèŠ‚ç‚¹æ˜¯å…¶ä»–èŠ‚ç‚¹çš„åä»£ï¼Œåº”è¯¥ç§»é™¤
              }
            } catch (e) {
              // å¦‚æœå‡ºé”™ï¼Œä¿ç•™èŠ‚ç‚¹
              // console.warn('Error in removeDuplicates:', e);
            }
          }
          return true;
        });
