      // åªå¯¹ç›´æ¥genreèŠ‚ç‚¹å»é‡ï¼ˆä¸åŒ…æ‹¬subcategoryèŠ‚ç‚¹ï¼‰
      const directGenreNodes = categoryNode.children.filter(node => directGenres.has(node.name));
      const subcategoryNodes = categoryNode.children.filter(node => !directGenres.has(node.name));

      if (directGenreNodes.length > 0) {
        try {
          const deduplicatedGenres = removeDuplicates(directGenreNodes);
          categoryNode.children = [...subcategoryNodes, ...deduplicatedGenres];
        } catch (e) {
          // å¦‚æœå»é‡å¤±è´¥ï¼Œè‡³å°‘ä¿ç•™æ‰€æœ‰èŠ‚ç‚¹
          // console.warn('Error in deduplication, keeping all nodes:', e);
          categoryNode.children = [...subcategoryNodes, ...directGenreNodes];
        }
