    // æ·»åŠ æ‰€æœ‰åˆ†ç±»ï¼ˆé™¤äº†External linksã€See alsoå’ŒBibliographyï¼‰ï¼Œå³ä½¿æš‚æ—¶æ²¡æœ‰å­èŠ‚ç‚¹
    if (categoryNode.name !== "External links" && categoryNode.name !== "See also" && categoryNode.name !== "Bibliography") {
      root.children.push(categoryNode);
