  return root;
}

// æå–å­èŠ‚ç‚¹ï¼ˆä¿ç•™nameå’Œscraped_infoå±æ€§ï¼‰
function extractChildren(node) {
  if (!node.children || !Array.isArray(node.children) || node.children.length === 0) {
    return [];
  }

  return node.children
    .filter(child => child && child.name)
