}

// è®¡ç®—èŠ‚ç‚¹å€¼
function calculateValue(node) {
  if (!node.children || node.children.length === 0) {
    return 1;
  }

  return node.children.reduce((sum, child) => sum + calculateValue(child), 0) || 1;
}

// æ·»åŠ å€¼åˆ°èŠ‚ç‚¹
function addValues(node) {
  if (node.children && node.children.length > 0) {
