      // console.log(`  æŸ¥æ‰¾ç¬¬${i+1}å±‚: ${name}, å½“å‰èŠ‚ç‚¹: ${newFocus.data.name}, å­èŠ‚ç‚¹æ•°: ${newFocus.children ? newFocus.children.length : 0}`);

      if (newFocus.children) {
        const found = newFocus.children.find(child => child.data.name === name);
        if (found) {
          newFocus = found;
          // console.log(`    æ‰¾åˆ°: ${found.data.name}, å­èŠ‚ç‚¹æ•°: ${found.children ? found.children.length : 0}`);
        } else {
          // console.log(`    æœªæ‰¾åˆ°èŠ‚ç‚¹: ${name}`);
          // console.log(`    å¯ç”¨èŠ‚ç‚¹:`, newFocus.children.map(c => c.data.name));
          // å¦‚æœæ‰¾ä¸åˆ°ï¼Œä½¿ç”¨æ ¹èŠ‚ç‚¹
          newFocus = root;
          break;
        }
      } else {
        // console.log("è·¯å¾„ä¸­æ–­ï¼ŒèŠ‚ç‚¹æ²¡æœ‰children");
        newFocus = root;
        break;
      }
    }

    // å¦‚æœè·¯å¾„ä¸ºç©ºï¼Œè¯´æ˜çˆ¶èŠ‚ç‚¹å°±æ˜¯æ ¹èŠ‚ç‚¹
    if (parentPath.length === 0) {
      newFocus = root;
    }

    // console.log("æœ€ç»ˆæ‰¾åˆ°çˆ¶èŠ‚ç‚¹:", newFocus.data.name, "å­èŠ‚ç‚¹æ•°:", newFocus.children ? newFocus.children.length : 0);
    if (newFocus.children) {
      // console.log("å­èŠ‚ç‚¹åˆ—è¡¨:", newFocus.children.map(c => c.data.name + " (value: " + c.value + ")"));
    }

    // è°ƒç”¨updateæ›´æ–°å›¾è¡¨ï¼Œæ˜¾ç¤ºçˆ¶èŠ‚ç‚¹çš„æ‰€æœ‰å­èŠ‚ç‚¹
    // ä¼ å…¥nullè®©updateå‡½æ•°ä½¿ç”¨å½“å‰focusï¼Œä½†æˆ‘ä»¬å·²ç»è®¾ç½®äº†newFocus
    focus = newFocus;
    update(null);
  }

  // åœ¨åŸå§‹æ•°æ®ä¸­æŸ¥æ‰¾èŠ‚ç‚¹çš„è¾…åŠ©å‡½æ•°
  function findNodeInOriginalData(nodeName, parent = originalRootData) {
    if (parent.name === nodeName) {
      return parent;
    }
    if (parent.children) {
      for (let child of parent.children) {
        const found = findNodeInOriginalData(nodeName, child);
        if (found) return found;
      }
    }
    return null;
  }

  // ç‚¹å‡»äº‹ä»¶å¤„ç† - ç®€åŒ–é€»è¾‘ï¼šç‚¹å‡»èŠ‚ç‚¹åèšç„¦åˆ°è¯¥èŠ‚ç‚¹æ˜¾ç¤ºå…¶å­èŠ‚ç‚¹
  function clicked(event, p) {
    event.stopPropagation();

    // console.log("=== ç‚¹å‡»äº‹ä»¶ ===");
    // console.log("ç‚¹å‡»èŠ‚ç‚¹:", p.data.name);
    // console.log("  - åˆå¹¶åæ•°æ®å­èŠ‚ç‚¹æ•°:", p.data.children ? p.data.children.length : 0);

    // æ£€æŸ¥åŸå§‹æ•°æ®ï¼ˆåˆå¹¶å‰ï¼‰æ˜¯å¦æœ‰å­èŠ‚ç‚¹
    const originalNode = findNodeInOriginalData(p.data.name);
    const hasOriginalChildren = originalNode && originalNode.children && originalNode.children.length > 0;

    // console.log("  - åŸå§‹æ•°æ®å­èŠ‚ç‚¹æ•°:", originalNode && originalNode.children ? originalNode.children.length : 0);
    // console.log("  - å½“å‰focus:", focus ? focus.data.name : "null");

    // å¦‚æœåŸå§‹æ•°æ®æ²¡æœ‰å­èŠ‚ç‚¹ï¼Œæ— æ³•å±•å¼€
    if (!hasOriginalChildren) {
      // console.log("èŠ‚ç‚¹åœ¨åŸå§‹æ•°æ®ä¸­æ²¡æœ‰å­èŠ‚ç‚¹ï¼Œæ— æ³•å±•å¼€");
      return;
    }

    // å¦‚æœåˆå¹¶åçš„æ•°æ®ä¸­èŠ‚ç‚¹æœ‰å­èŠ‚ç‚¹ï¼Œç›´æ¥ä½¿ç”¨åˆå¹¶åçš„æ•°æ®
    // å¦‚æœåˆå¹¶åçš„æ•°æ®ä¸­èŠ‚ç‚¹æ²¡æœ‰å­èŠ‚ç‚¹ï¼Œä½†åŸå§‹æ•°æ®æœ‰ï¼Œéœ€è¦æ¢å¤å­èŠ‚ç‚¹
    if (!p.data.children || p.data.children.length === 0) {
      // ä»åŸå§‹æ•°æ®ä¸­æ¢å¤å­èŠ‚ç‚¹
      if (originalNode && originalNode.children && originalNode.children.length > 0) {
        // æ£€æŸ¥å½“å‰èŠ‚ç‚¹çš„æ·±åº¦ï¼Œå¦‚æœæ˜¯åˆ†ç±»èŠ‚ç‚¹çš„ç›´æ¥å­èŠ‚ç‚¹ï¼ˆdepth=2ï¼‰ï¼Œä¿ç•™æ‰€æœ‰å­èŠ‚ç‚¹ï¼ˆåŒ…æ‹¬å¶å­èŠ‚ç‚¹ï¼‰
        // å¦åˆ™åªä¿ç•™éå¶å­å­èŠ‚ç‚¹
        const nodeDepth = p.depth || 0;
        const isCategoryDirectChild = nodeDepth === 2;

        let restoredChildren;
        if (isCategoryDirectChild) {
          // å¯¹äºåˆ†ç±»èŠ‚ç‚¹çš„ç›´æ¥å­èŠ‚ç‚¹ï¼Œä¿ç•™æ‰€æœ‰å­èŠ‚ç‚¹ï¼ˆåŒ…æ‹¬å¶å­èŠ‚ç‚¹ï¼‰
          restoredChildren = originalNode.children.map(child => ({
            name: child.name,
            scraped_info: child.scraped_info || null,
            children: child.children || []
          }));
        } else {
          // å¯¹äºå…¶ä»–èŠ‚ç‚¹ï¼Œåªæ¢å¤éå¶å­å­èŠ‚ç‚¹
          restoredChildren = originalNode.children
            .filter(child => child.children && child.children.length > 0)
            .map(child => ({
              name: child.name,
              scraped_info: child.scraped_info || null,
              children: child.children ? child.children.filter(c => 
                c.children && c.children.length > 0
              ) : []
            }));
        }

        if (restoredChildren.length > 0) {
          // æ›´æ–°åˆå¹¶åçš„æ•°æ®
          p.data.children = restoredChildren;
          // é‡æ–°è®¡ç®—å€¼
          addValues(p.data);
          // console.log(`  æ¢å¤å­èŠ‚ç‚¹: ${restoredChildren.length}ä¸ª`);
        }
      }
    }

    // é‡æ–°åˆ›å»ºhierarchyä»¥è·å–å®Œæ•´çš„èŠ‚ç‚¹ç»“æ„
    root = createHierarchy(rootData);

    // æ„å»ºä»æ ¹èŠ‚ç‚¹åˆ°å½“å‰èŠ‚ç‚¹çš„å®Œæ•´è·¯å¾„
    const path = [];
    let current = p;
    while (current && current.parent) {
      path.unshift(current.data.name);
      current = current.parent;
    }
    // console.log("èŠ‚ç‚¹è·¯å¾„:", path);

    // åœ¨æ–°hierarchyä¸­æ²¿ç€è·¯å¾„æ‰¾åˆ°èŠ‚ç‚¹
    let newFocus = root;
    for (let i = 0; i < path.length; i++) {
      const name = path[i];
      // console.log(`  æŸ¥æ‰¾ç¬¬${i+1}å±‚: ${name}, å½“å‰èŠ‚ç‚¹: ${newFocus.data.name}, å­èŠ‚ç‚¹æ•°: ${newFocus.children ? newFocus.children.length : 0}`);

      if (newFocus.children) {
        const found = newFocus.children.find(child => child.data.name === name);
        if (found) {
          newFocus = found;
          // console.log(`    æ‰¾åˆ°: ${found.data.name}, å­èŠ‚ç‚¹æ•°: ${found.children ? found.children.length : 0}`);
        } else {
          // console.log(`    æœªæ‰¾åˆ°èŠ‚ç‚¹: ${name}`);
          // console.log(`    å¯ç”¨èŠ‚ç‚¹:`, newFocus.children.map(c => c.data.name));
          return;
        }
      } else {
        // console.log("è·¯å¾„ä¸­æ–­ï¼ŒèŠ‚ç‚¹æ²¡æœ‰children:", newFocus.data.name);
        return;
      }
    }

    // console.log("æœ€ç»ˆæ‰¾åˆ°èŠ‚ç‚¹:", newFocus.data.name, "å­èŠ‚ç‚¹æ•°:", newFocus.children ? newFocus.children.length : 0);

    // è®¾ç½®æ–°çš„ç„¦ç‚¹å¹¶æ›´æ–°
    if (newFocus && newFocus.children && newFocus.children.length > 0) {
      focus = newFocus;
      // console.log("è®¾ç½®æ–°ç„¦ç‚¹å¹¶æ›´æ–°");
      update(newFocus);
    } else {
      // console.log("æ‰¾åˆ°çš„èŠ‚ç‚¹æ²¡æœ‰å­èŠ‚ç‚¹ï¼Œæ— æ³•å±•å¼€");
    }
  }

  // æ›´æ–°é¢åŒ…å±‘å¯¼èˆª
  function updateBreadcrumb() {
    const breadcrumb = d3.select("#breadcrumb");
    const ancestors = focus.ancestors().reverse().slice(1);

    if (ancestors.length === 0) {
      breadcrumb.html("");
      return;
    }

    if (ancestors.length > 0) {
      breadcrumb.html(
        '<span class="ancestor home" data-action="home">ğŸ  é¦–é¡µ</span> <span class="separator">/</span> ' +
        ancestors.map((d, i) => {
          if (i === ancestors.length - 1) {
            return `<span class="current">${d.data.name}</span>`;
          } else {
            return `<span class="ancestor" data-index="${i}">${d.data.name}</span>`;
          }
        }).join(' <span class="separator">/</span> ')
      );

      // æ·»åŠ é¦–é¡µæŒ‰é’®ç‚¹å‡»äº‹ä»¶
      breadcrumb.selectAll("span.home")
        .on("click", function(event) {
          focus = root;
          root = createHierarchy(rootData);
          update();
        });
    } else {
      breadcrumb.html("");
    }

    // æ·»åŠ ç‚¹å‡»äº‹ä»¶
    breadcrumb.selectAll("span.ancestor")
      .on("click", function(event) {
        const index = +this.getAttribute("data-index");
        const target = ancestors[index];
        focus = target;
        root = createHierarchy(rootData);
        update(target);
      });
  }

  // åˆå§‹åŒ–
  root = createHierarchy(rootData);
  focus = root;
  update();
}

